import React from 'react'
import dh_logo from '../images/DH.png';
import dentistImage from '../images/doctor.jpg';
import '@fortawesome/fontawesome-free/css/all.min.css';
import { faEnvelope, faFacebook, faWhatsapp } from '@fortawesome/free-solid-svg-icons';



const Footer = () => {
  return (
    <footer className='fo_display'>
        <div className='fo_display'>
          <p>Powered by</p>
          <img src={dh_logo} alt='DH-logo' />
        </div>
        <div className='fo_display'>

        
        <i className="fas fa-envelope"></i> {/* Icono de sobre */}
        <i className="fab fa-facebook"></i> {/* Icono de Facebook */}
        <i className="fab fa-whatsapp"></i> {/* Icono de WhatsApp */}

          

        </div>

    </footer>
  )
}

export default Footer
